const Contact = () => {
    const myStyleForm = {
        input : {
            margin:"15px",
            padding:"10px",
            border:"none",
            width:"25vw"
        },
        div:{
            backgroundColor: "black",
            width:"60%",
            height:"250px",
            display:"flex",
            flexDirection:"row",
            flexWrap:"wrap",
            margin:"25px",
        },
        h2:{
            textAlign:"center",
            color:"white"
        }
    }
    return(
        <>

            <div style={myStyleForm.div}>
            <h2 style={myStyleForm.h2}>CONTACT US</h2>
                <form>
                    <input style={myStyleForm.input}
                    type="text"
                    onChange={InputEvent}
                    placeholder="Enter Your Contact"
                    value={Number}
                    name="email"
                    />
                    <input style={myStyleForm.input}
                    type="text"
                    onChange={InputEvent}
                    placeholder="Email"
                    value={Number}
                    name="email"
                    />
                    <input style={myStyleForm.input}
                    type="textArea"
                    onChange={InputEvent}
                    placeholder="message"
                    value=""
                    name="message"
                    />
                </form>
            </div>
        </>
    )
}

export default Contact;
